// Dashboard.js
import React from 'react';
import { useClerk } from '@clerk/clerk-react';

function Dashboard() {
  const { signOut } = useClerk();

  return (
    <div>
      <h1>Welcome to the Dashboard!</h1>
      <button onClick={() => signOut()}>Sign Out</button>
    </div>
  );
}

export default Dashboard;
